<!DOCTYPE html>
<html>
<head>
    <title>Admin List</title>
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <style>
        body {
            margin: 0;
            padding: 0;
            height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            transition: background-color 0.3s ease, color 0.3s ease;
      background-size: cover;
      background-repeat: no-repeat;
      background-position: center;
      color: white; /* Default text color */
        }

        h1 {
            margin-bottom: 20px;
            color: white;
            text-align: center;
        }

        .admin-list-container {
            width: 100%;
            max-height: 400px;
            overflow-y: auto;
        }

        ul {
            list-style-type: none;
            padding: 0;
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
        }

        .admin-info {
            width: calc(100% - 20px); /* Subtracting padding */
            max-width: 300px; /* Limiting width for larger screens */
            margin: 5px;
            padding: 10px;
            border: 1px solid #ccc;
            background-color: rgba(255, 255, 255, 0.7);
            border-radius: 5px;
            display: flex;
            align-items: center;
        }

        .admin-info img {
            width: 80px;
            height: 80px;
            margin-right: 10px;
            border-radius: 50%;
        }

        .admin-info span {
            font-weight: bold;
            color: #333;
        }

        @media only screen and (min-width: 768px) {
            .admin-list-container {
                max-height: none;
                overflow-y: visible;
            }

            .admin-info {
                width: 200px;
            }

            .admin-info img {
                width: 100px;
                height: 100px;
            }
        }
    </style>
</head>

    <h1>Admin List</h1>
